          options={{height: 400}}
        />*/}
        {/*<TwitterShareButton 
          url="https://drek.si/"
          options={{text: "#reactjs is awesome", via: "cleverqazi"}}
        />*/}

      </div>
    </div>
  );
}

export default Widgets;
